import { Link } from "react-router-dom";

function BlogCard() {
  return (
    <>
      <Link>
        <div className="m-4">
          <div className="card">
            <img
              src="https://placehold.jp/150x150.png"
              className="card-img-top"
              alt="..."
            />
            <div className="card-body">
              <h5 className="card-title">
                {props.title}
              </h5>
            </div>
          </div>
        </div>
      </Link>
    </>
  );
}

export default BlogCard;
